	<script type="text/javascript">
		var isMouseDown = false;
		document.addEventListener('mousedown', function(e) {
			isMouseDown = true;
		});

		document.addEventListener('mouseup', function(e) {
			isMouseDown = false;
		});

		var colors = document.querySelectorAll('.legend li span');
		var currentColor = null;

		[].forEach.call(colors, function(node){
			node.addEventListener("click", function(e){
				var active = document.querySelector('.legend li.active');

				if( active )
					document.querySelector('.legend li.active').classList.remove('active');

				if( this.dataset.color === currentColor ) {
					currentColor = null;
				}
				else {
					this.parentElement.classList.add('active');
					currentColor = this.dataset.color;
				}
			});
		});

		var polys = document.getElementsByTagName('polygon');

		[].forEach.call(polys, function(node){
			node.addEventListener("mouseover", function(e){
				if( isMouseDown ) {
					this.setAttribute('class', 'grid');

					if( currentColor ) {
						this.classList.add(currentColor);
					}
				}
			});
		}, true);
	</script>
